import React from 'react';
// import "./index.css";
import AddCircleOutlinedIcon from '@material-ui/icons/AddCircleOutlined';


const App = () => {
  
  return (
    <>

       <h2>ToDo List</h2>

       <input type="text" />
       <AddCircleOutlinedIcon/>
       
       
    </>
  )
}

export default App;
